import { BrowserRouter, Route } from "react-router-dom";
import Work from "./pages/Work";

function App() {
  return (
    <div className="App">
      <Work/>

    <BrowserRouter>
    <Route>
    <Work/>
    </Route>
    </BrowserRouter>
    </div>
  );
}

export default App;
